package com.coding.challenge.dp;

class VowelsOfAllSubstrings {
	VowelsOfAllSubstrings() {
		throw new AssertionError();
	}

	public static void main(String[] args) {
		final String w1 = "aba";
		assert countVowels(w1) == 6;

		final String w2 = "abc";
		assert countVowels(w2) == 3;

		final String w3 = "ltcd";
		assert countVowels(w3) == 0;

		assert countVowels("b") == 0;

//		final String w4 = "";
//		vowelCnt = countVowels(w4);
//		assert vowelCnt == 32003263569662l;
	}

	static long countVowels(String word) {
		final int n = word.length();
		int delta = n + 2;
		long vowelsCnt = 0;
		long subStrCnt = 0;

		for (int i = 0; i < n; i++) {
			delta = delta - 2;
			subStrCnt = subStrCnt + delta;
			if (isVowel(word.charAt(i)))
				vowelsCnt = vowelsCnt + subStrCnt;
		}
		return vowelsCnt;
	}

	static boolean isVowel(char ch) {
		return ch == 'a' || ch == 'e' || ch == 'i' || ch == 'o' || ch == 'u';
	}
}
